contracts/aquo/AquoNewDeployv3.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "./AquoAssetTransferv3.sol";
import "./AquoContractListv3.sol";
import "./AquoProspectusList2v3.sol";

contract DeployContract {

    ContractList public contractList;
    ProspectusRegistry public prospectusRegistry;

    // Event to log the address of the deployed asset contract
    event contractDeployed(address contractAddress);

    constructor(address _contractList, address _prospectusRegistry) {
        contractList = ContractList(_contractList);
        //ProspectusRegistry = ProspectusRegistry(_prospectusRegistry);
        prospectusRegistry = ProspectusRegistry(_prospectusRegistry); // Fixed this line

    }

    function deployAndRegisterContract(
           string memory _pdfAddress,
           string memory _imageAddress, 
           uint256 _initialShares
           ) public returns (address) {
        require(bytes(_pdfAddress).length != 0, "PDF address is missing");
         require(bytes(_imageAddress).length != 0, "Image address is missing");
         require(_initialShares > 0, "Initial shares must be greater than zero");


        // Deploy the Asset contract
        AssetContract newContract = new AssetContract(_initialShares, msg.sender);
        // Register the asset in the AssetManager
        contractList.listContract(address(newContract), _pdfAddress);

        //ProspectusRegistry newProspectus = new ProspectusRegistry();
        prospectusRegistry.addRecord(_pdfAddress, _imageAddress); // Fixed this line


       // prospectusRegistry.addRecord(address(newProspectus), _pdfAddress, _imageAddress);

        // Emit the event
        emit contractDeployed(address(newContract));

        return address(newContract);
    }
}

contracts/aquo/AquoProspectusList2v3.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract ProspectusRegistry {
    
    // Updated struct to hold the IPFS address for the prospectus and image, and the proposer's wallet address
    struct ProspectusRecord {
        string prospectusCid;
        string imageCid;
        address proposer;
    }
    
    // Array to hold all the ProspectusRecord entries
    ProspectusRecord[] public records;
    
    // Mappings to check for unique IPFS entries for both prospectus and image
    mapping(string => bool) private prospectusCidExists;
    mapping(string => bool) private imageCidExists;
    mapping(string => ProspectusRecord) private cidToProspectusRecord; // New mapping


    // Updated function to add a new record with both prospectus and image CIDs
    function addRecord(string memory _prospectusCid, string memory _imageCid) public {
        // Ensure the IPFS addresses haven't been added before
       // require(!prospectusCidExists[_prospectusCid], "Prospectus CID already exists");
       // require(!imageCidExists[_imageCid], "Image CID already exists");
        
        if(prospectusCidExists[_prospectusCid] || imageCidExists[_imageCid]) {
            return;
        }

        ProspectusRecord memory newRecord = ProspectusRecord({
        prospectusCid: _prospectusCid,
        imageCid: _imageCid,
        proposer: msg.sender
        });

        records.push(newRecord);       
        
        // Mark the IPFS addresses as added
        prospectusCidExists[_prospectusCid] = true;
        imageCidExists[_imageCid] = true;
        cidToProspectusRecord[_prospectusCid] = newRecord; // Store the record in the new mapping

    }

    // Get the total number of records
    function getRecordCount() public view returns (uint) {
        return records.length;
    }
    
    // Get a specific record by index
    function getRecord(uint _index) public view returns (ProspectusRecord memory) {
        require(_index < records.length, "Index out of bounds");
        return records[_index];
    }

    function getAllRecords() public view returns (ProspectusRecord[] memory) {
        return records;
    }

    function getProspectusRecord(string memory _prospectusCid) public view returns (ProspectusRecord memory) {
        require(prospectusCidExists[_prospectusCid], "Prospectus CID does not exist");
        return cidToProspectusRecord[_prospectusCid];
    }
}

contracts/aquo/AquoContractListv3.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

contract ContractList {
    struct Contract {
        uint256 contractId;
        string ipfsAddress;
        address contractAddress;
    }

    Contract[] private contracts;
    uint256 private nextContractId = 1;
    mapping(uint256 => uint256) internal contractIdToIndex;
    mapping(address => uint256) internal contractAddressToIndex;
    mapping(address => bool) internal contractAddressExists;
    mapping(address => bool) internal unallocatedContracts;  // True if ipfsAddress is null

    function listContract(address _contractAddress, string memory _ipfsAddress) public returns (uint256) {
        require(!contractAddressExists[_contractAddress], "Contract Address already exists");

        uint256 contractId = nextContractId++;
        Contract memory newContract = Contract({
            contractId: contractId,
            ipfsAddress: _ipfsAddress,
            contractAddress: _contractAddress
        });
        contracts.push(newContract);
        uint256 index = contracts.length - 1;
        contractIdToIndex[contractId] = index;
        contractAddressToIndex[_contractAddress] = index;
        contractAddressExists[_contractAddress] = true;
        unallocatedContracts[_contractAddress] = false; // default

        return contractId;
    }

    function getAssetByContractAddress(address _contractAddress) public view returns (Contract memory) {
        uint256 index = contractAddressToIndex[_contractAddress];
        return contracts[index];
    }

    function getContractByContractId(uint256 _contractId) public view returns (Contract memory) {
        uint256 index = contractIdToIndex[_contractId];
        return contracts[index];
    }

    function getAllContracts() public view returns (Contract[] memory) {
        return contracts;
    }
}

contracts/aquo/AquoAssetTransferv3.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

contract AssetContract {
    address public owner;
    mapping(address => uint256) private shareBalances; // Mapping to keep track of balances
    address[] private holderAddresses; // Array to keep track of all addresses ever held shares

    struct Holder {
        address addr;
        uint256 balance;
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "Not the owner");
        _;
    }

    constructor(uint256 _initialShares, address _owner) {
        owner = _owner;
        shareBalances[_owner] = _initialShares;
        holderAddresses.push(_owner); // Add the owner to the holder addresses array
    }

    function balanceOf(address _user) public view returns (uint256) {
        return shareBalances[_user];
    }

    function transferShares(address _to, uint256 _amount) public {
        require(shareBalances[msg.sender] >= _amount, "Insufficient shares");
        shareBalances[msg.sender] -= _amount;
        shareBalances[_to] += _amount;

        if (shareBalances[_to] == _amount) { // if the balance was zero before transfer
            holderAddresses.push(_to); // Add the recipient to the holder addresses array
        }
    }

    function getHolders() public view returns (Holder[] memory) {
        Holder[] memory holders = new Holder[](holderAddresses.length);
        for (uint256 i = 0; i < holderAddresses.length; i++) {
            holders[i] = Holder(holderAddresses[i], shareBalances[holderAddresses[i]]);
        }
        return holders;
    }
}

